import React, {Component} from 'react';
import { StyleSheet, View, Alert, Image, ActivityIndicator, AsyncStorage } from 'react-native';
import { Container, Content, Card, CardItem, Body, Text, Button, Form, Item, Label, Input, Icon, Right } from 'native-base';

export default class Cart extends Component {
    constructor(props){
        super(props);        
        this.state ={
          cart: false,
          loader: true
        };
    }
    async getToCart(){    
        if(!this.state.cart){
            const value = await AsyncStorage.getItem('@cart');
            this.setState({cart: JSON.parse(value), loader: false});
        }
    } 
    a(){
        console.log('aaaa');
    }
    render(){   
        this.a();
        this.getToCart();
        if(this.state.loader){
            return(
                <Container>
                    <ActivityIndicator size="large" color="red" />   
                </Container>      
            )    
        }
        console.log(this);
        return(<Image onPress={()=>this.a()} source={{uri: 'https://noticiasbancarias.com/wp-content/plugins/accelerated-mobile-pages/images/SD-default-image.png'}} style={{height: 80, width: 80, flex: 1, resizeMode: 'cover', alignSelf: 'stretch'}}/>

        )
    }
}
